const data = [{"_nombre":"Los expertos en tecnología impulsarán la economía","_imagen":"data:image/jpeg;base64,","_id":1714597338164,"_descripcion":"Algunos economistas nos dicen que las grandes innovaciones ya han tocado techo, que la productividad se ha estancado y que hemos comido los frutos de la ciencia que estaban a nuestro alcance. Pero investigadores de todo el mundo plantean la tentadora posibilidad de que los sistemas de aprendizaje automático y las nuevas metodologías de investigación puedan proporcionarnos una escalera que nos ayude a alcanzar las manzanas jugosas de lo alto del árbol.\n\nEn términos generales, la investigación necesita un impulso. Un documento publicado este año en el American Economic Review (AER) puso de relieve la dificultad de innovar. Aunque las aportaciones a la investigación han aumentado a lo largo de las últimas décadas, los resultados han disminuido a un ritmo más rápido.","_categoria":"Technology"},{"_nombre":"Qué es la Big Data y cómo funciona","_imagen":"data:image/jpeg;base64,","_id":1714605517748,"_descripcion":"Este se define como la cantidad de información y datos que una empresa y organización reciben diariamente. Un punto importante de toda esta cantidad de información es lo que se puede hacer con ella. Todo se hace con el fin de conseguir los mejores insights para una buena toma de decisiones y aplicar estrategias eficaces.","_categoria":"Technology"},{"_nombre":"Cómo hacer hamburguesa de atún","_imagen":"data:image/jpeg;base64,","_id":1714605633160,"_descripcion":"Las hamburguesas son una comida perfecta para comer un fin de semana en compañía dela familia y los amigos, la receta clásica es con carne de res. Para que tengas una opción diferente y fácil de preparar te decimos cómo hacer hamburguesa de atún.","_categoria":"Food"},{"_nombre":"Half life 1","_imagen":"data:image/webp;base64,","_id":1714605761303,"_descripcion":"Hablar de Half-Life es hacerlo de uno de los mejores juegos de la historia, un shooter en primera persona que sentó las bases para el futuro del género, de la mano de Valve. Fue uno de los mejores títulos de aquel glorioso año 1998.","_categoria":"Entertaiment"},{"_nombre":"Minecraft","_imagen":"data:image/webp;base64,","_id":1714605866962,"_descripcion":"Minecraft es un juego que consiste en colocar bloques y aventurarse.\n\nExplora mundos generados al azar y construye cosas increíbles, desde la más humilde de las casas hasta el más majestuoso de los castillos. Juega en el modo creativo con recursos ilimitados o extrae en las profundidades del mundo, crea armas y armaduras para defenderte de enemigos peligrosos en el modo supervivencia.","_categoria":"Entertaiment"}]